const RegDetails=[
  {
    classN:"row  mt-5",
    type:"text",
    for:"firstname",
    labelC:"col-4",
    name:"First Name:",
    inputC:"form-control col-5",
    placeholder:"First Name"
  },
  {
    classN:"row  mt-5",
    type:"text",
    for:"lastname",
    labelC:"col-4",
    name:"Last Name:",
    inputC:"form-control col-5",
    placeholder:"Last Name"
  },
  {
    classN:"row  mt-5",
    type:"",
    for:"id_num",
    labelC:"col-4",
    name:"ID number:",
    inputC:"form-control col-5",
    placeholder:"ID number"
  },
  {
    classN:"row mt-5",
    type:"email",
    for:"email",
    labelC:"col-4",
    name:"E-mail:",
    inputC:"form-control col-5",
    placeholder:"Enter your Email"
  },
  {
    classN:"row mt-5",
    type:"tel",
    for:"phone",
    labelC:"col-4",
    name:"Phone Number:",
    inputC:"form-control col-5",
    placeholder:"Phone Number",
  },
  {
    classN:"row  mt-5",
    type:"text",
    for:"city",
    labelC:"col-4",
    name:"City:",
    inputC:"form-control col-5",
    placeholder:"City"
  },
  {
    classN:"row  mt-5",
    type:"text",
    for:"street",
    labelC:"col-4",
    name:"Street:",
    inputC:"form-control col-5",
    placeholder:"street"
  },
  {
    classN:"row  mt-5",
    type:"text",
    for:"zip",
    labelC:"col-4",
    name:"Zip Code:",
    inputC:"form-control col-5",
    placeholder:"Zip code"
  },
  {
    classN:"row mt-5",
    type:"date",
    for:"BirthDate",
    labelC:"col-4 col-form-label",
    name:"Date of birth:",
    inputC:"form-control col-5",
    placeholder:""
  },
  {
    classN:"row  mt-5",
    type:"text",
    for:"usrname",
    labelC:"col-4",
    name:"Username:",
    inputC:"form-control col-5",
    placeholder:"Choose Username"
  },
  {
    classN:"row  mt-5",
    type:"text",
    for:"psw",
    labelC:"col-4",
    name:"Password:",
    inputC:"form-control col-5",
    placeholder:"Enter Password"
  },
  {
    classN:"row  mt-5",
    type:"text",
    for:"psw-repeat",
    labelC:"col-4",
    name:"Repeat Password:",
    inputC:"form-control col-5",
    placeholder:"Repeat Password"
  }

]
export default RegDetails
